import { ReactNode, CSSProperties, useState } from "react";
import ToDoListItem from "../ToDoListItem";

type Todo = {
  id: number;
  text: string;
  checked: boolean;
};

export default function ToDoList() {
  const [todoList, setTodoList] = useState<Todo[]>([
    {
      id: 1,
      text: "First Todo",
      checked: false,
    },
    {
      id: 2,
      text: "Second Todo",
      checked: true,
    },
  ]);
  return (
    <ToDoListItem.todo
      type={"checkbox"}
      checked={false}
      onChecked={(checked) => {
        console.log(checked);
      }}
    />
  );
}
